import React from "react";
import {useState} from "react";

function Todo(){

    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>console.log(json))
    }

    return (
        <div>
            <h1 onClick={apiGet}>Hi</h1>
        </div>
    )
}

export default Todo
